class RobotGrid:
    def __init__(self, grid: str):
        self.grid = grid.split('\n')
        self.start_pos = self.goal_pos = None
        self.obstacles = set()
        for i in range(len(self.grid)):
            for j in range(len(self.grid[i])):
                if self.grid[i][j] == 'S':
                    self.start_pos = (i, j)
                elif self.grid[i][j] == 'G':
                    self.goal_pos = (i, j)
                elif self.grid[i][j] == '#':
                    self.obstacles.add((i, j))

    def move(self, pos, direction):
        if direction == 'L':
            new_pos = (pos[0], pos[1] - 1)
        elif direction == 'R':
            new_pos = (pos[0], pos[1] + 1)
        elif direction == 'U':
            new_pos = (pos[0] - 1, pos[1])
        elif direction == 'D':
            new_pos = (pos[0] + 1, pos[1])
        else:
            return False
        if (0 <= new_pos[0] < len(self.grid) and 0 <= new_pos[1] < len(self.grid[0]) and
            (new_pos not in self.obstacles) and (new_pos != self.goal_pos)):
            return new_pos
        return None

